    <Fragment onMouseEnter={handleHover} onMouseLeave={handleLeave}>
      {!isDelete && (
        <div className={isHovered ? classes.gradientHover : classes.gradient} />
      )}
      {isDelete && (
        <div
          className={isHovered ? classes.gradientHoverDelete : classes.gradient}
        />
      )}
      <img
        className={classes.button}
        src={isDelete ? TrashOpenIcon : TrashClosedIcon}
        alt="Delete"
      />
    </Fragment>
  );
};

export default DeleteButton;
